import{_ as t,c as e,o as a,a4 as o}from"./chunks/framework.uQk9_EO2.js";const l="/docs/cocos/assets/overview.D0A-7QhO.png",s="/docs/cocos/assets/add.kaiAAAxo.png",r="/docs/cocos/assets/dev-lang.a5e4cUti.png",n="/docs/cocos/assets/pingguo.CkI4ftIw.png",c="/docs/cocos/assets/apple-key.BKCet25s.png",i="/docs/cocos/assets/english.4O9xGomb.png",A="/docs/cocos/assets/apple-variant.fbaPqz13.png",p="/docs/cocos/assets/variant-result.CwDbUdAu.gif",d="data:image/png;base64,",g="data:image/png;base64,",h="/docs/cocos/assets/compile.CTKRt7BG.png",b="/docs/cocos/assets/select-key.Cdz7nPIG.png",C=JSON.parse('{"title":"L10nLabel 组件","description":"","frontmatter":{},"headers":[],"relativePath":"zh/editor/l10n/l10n-label.md","filePath":"zh/editor/l10n/l10n-label.md","lastUpdated":1712305443000}'),m={name:"zh/editor/l10n/l10n-label.md"},f=o('<h1 id="l10nlabel-组件" tabindex="-1">L10nLabel 组件 <a class="header-anchor" href="#l10nlabel-组件" aria-label="Permalink to &quot;L10nLabel 组件&quot;">​</a></h1><p>L10nLabel 是可以根据内容进行定制化翻译的组件。配合文本组件使用，可对文本组件的内容进行翻译。</p><p><img src="'+l+'" alt="overview"></p><h2 id="添加组件" tabindex="-1">添加组件 <a class="header-anchor" href="#添加组件" aria-label="Permalink to &quot;添加组件&quot;">​</a></h2><p>用户可以在 <strong>属性检查器</strong> 上点击 <strong>添加组件</strong> 并选择 L10nLabel 来添加：</p><p><img src="'+s+'" alt="add"></p><blockquote><p><strong>注意</strong>：L10nLabel 必须搭配 Label 组件才可以使用，如果节点上没有 Label 组件，则会自动创建一个。</p></blockquote><h2 id="属性和说明" tabindex="-1">属性和说明 <a class="header-anchor" href="#属性和说明" aria-label="Permalink to &quot;属性和说明&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">属性</th><th style="text-align:left;">说明</th></tr></thead><tbody><tr><td style="text-align:left;"><strong>String</strong></td><td style="text-align:left;">Label 组件内文本 <br> 不可编辑</td></tr><tr><td style="text-align:left;"><strong>Count</strong></td><td style="text-align:left;">变体数量 <br> 详情请参考下文</td></tr><tr><td style="text-align:left;"><strong>Key</strong></td><td style="text-align:left;">本地化的键值</td></tr></tbody></table><h3 id="变体数量" tabindex="-1">变体数量 <a class="header-anchor" href="#变体数量" aria-label="Permalink to &quot;变体数量&quot;">​</a></h3><p>通过输入不同的数量，本地化会切换不同的变体。</p><p>在某些语言中，表示单数和复数会采用不同的格式，比如在英语中，一个苹果表述为：one apple，而两个苹果则会使用苹果的复数格式：two apples。为了可以在翻译后使用正确的格式，我们可以在 <strong>变体数量</strong> 内填入当前这句话内指定的物体的数量究竟是多少。</p><p>通常来说，不同语言的变体数量和当地语言有关，开发者可以向母语者进行咨询。</p><p>例如：英语有单数/复数的区别，因此在配置时变体有两种 <code>one</code> 和 <code>other</code>。某些语言如阿拉伯语有 5 种变体而俄语有 3 种变体。引擎通过适配国际规则来生成变体的数量，如果希望了解这些规则，可以参考下列地址：</p><ul><li>ECMAScript Internationalization API：<a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Intl/PluralRules" target="_blank" rel="noreferrer">https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Intl/PluralRules</a></li><li>Unicode CLDR Project：<a href="https://cldr.unicode.org/" target="_blank" rel="noreferrer">https://cldr.unicode.org/</a></li></ul><p>下面我们将通过一个详细的例子来进行说明，对于不熟悉 <strong>本地化编辑</strong> 面板的用户，可以先参考 <a href="./overview">本地化</a>：</p><ul><li><p>首先启用 <strong>本地化编辑</strong>，并选择中文作为开发语言：</p><p><img src="'+r+'" alt="dev-lang"></p></li><li><p>在场景内添加一个带有 Label 组件的节点：</p><p><img src="'+n+'" alt="apple"></p></li><li><p>给这个节点添加一个 L10nLabel 的组件，并将 Key 修改为：apple-key:</p><p><img src="'+c+'" alt="apple-key"></p></li><li><p>添加需要翻译的语言为英语</p><p><img src="'+i+'" alt="english"></p></li><li><p>在 <strong>翻译</strong> 界面内添加变体：</p><p><img src="'+A+'" alt="l10nlabel/apple-variant.png"></p></li><li><p>点击 <strong>本地化编辑</strong> 面板的 <strong>预览</strong> 操作，可以预览翻译后的结果，在 Count 属性中切换单数/复数时，将会显示不同的变体：</p><p><img src="'+p+'" alt="result"></p></li></ul><h3 id="键" tabindex="-1">键 <a class="header-anchor" href="#键" aria-label="Permalink to &quot;键&quot;">​</a></h3><p>全局唯一的键，本地化会根据键不同，获取到该键在本地化中的结果。开发者可以自行输入自定义的键。也可以通过 <strong>重置</strong> 增加新的键。</p><p><img src="'+d+'" alt="key"></p><h4 id="重置键" tabindex="-1">重置键 <a class="header-anchor" href="#重置键" aria-label="Permalink to &quot;重置键&quot;">​</a></h4><p><img src="'+g+'" alt="reset"></p><p>如果需要新的键可以点击图示的重置按钮，此时 L10N 将会生成新的键，这些键随后也可以在 <strong>本地化编辑</strong> 中，在 <strong>编译</strong> 操作打开的面板内进行编辑：</p><p><img src="'+h+'" alt="compile"></p><p>详情请参考 <a href="./compile-language">语言编译</a></p><h4 id="选择键" tabindex="-1">选择键 <a class="header-anchor" href="#选择键" aria-label="Permalink to &quot;选择键&quot;">​</a></h4><p>通过图示的下拉菜单可以选择已有键：</p><p><img src="'+b+'" alt="select"></p>',28),q=[f];function u(S,V,X,R,v,P){return a(),e("div",null,q)}const x=t(m,[["render",u]]);export{C as __pageData,x as default};
